import React from "react";
import { NavbarWrap } from "../../styles/components/Dashboard/NavbarStyle";
import { AiOutlineMenu, AiFillHome, AiFillDatabase } from "react-icons/ai";

export default function Navbar() {
  return (
    <NavbarWrap>
      <AiOutlineMenu />
      <AiFillHome />
      <AiFillDatabase />
    </NavbarWrap>
  );
}
